import React, { Component } from "react";
import FoodItem from './../foodItem';

const items = [
  {
    name: "Chicken Momo",
    description: "Very Delicious Momo",
    image: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F399413060685075529%2F&psig=AOvVaw20Rrpnu1AM6V72TWzzLNDT&ust=1602425421701000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNiu2IeaquwCFQAAAAAdAAAAABAD"
  },
  {
    name: "Veg Momo",
    description: "Very Delicious Momo",
    image: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F399413060685075529%2F&psig=AOvVaw20Rrpnu1AM6V72TWzzLNDT&ust=1602425421701000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNiu2IeaquwCFQAAAAAdAAAAABAD"
  }
];

class FoodItems extends Component {

  render() {
    return (
      <div>
        <h2>Our Menu</h2>
        {
          items.map(item => (
            <FoodItem name={item.name} image={item.image} description={this.description}></FoodItem>
           // <li>{item.name}</li>
          ))
        }

      </div>
    );
  }
}

export default FoodItems;
